Centauri.Components.FileSelectorComponent = (type, cb = null) => {
    if(type == "show") {
        let $modal = $("#modal-new_contentelement");
        $modal.hide();

        let $fileselector = $("#file-selector");

        $(".item", $fileselector).each(function() {
            let $item = $(this);

            $item.click(e => {
                $(this).toggleClass("selected");
            });
        });

        $(".buttons button", $fileselector).each(function() {
            let $btn = $(this);

            $btn.click(e => {
                if($(this).hasClass("save")) {
                    let selectedFiles = $(".item.selected", $fileselector);

                    Centauri.Notify("success", "File-Selector", selectedFiles.length + " file(s) has been selected.");

                    if(Centauri.isNotNull(cb)) {
                        let selectedUids = "";

                        $(selectedFiles).each(function(index) {
                            let uid = $(this).data("uid");
                            selectedUids += uid + ((index + 1) != selectedFiles.length ? "," : "");
                        });

                        cb({
                            selectedFiles: selectedFiles,
                            selectedUids: selectedUids
                        });
                    } else {
                        console.error("Centauri.Component.FileSelectorComponent: Callback (" + cb + " [" + typeof cb + "]) can't be null!");
                    }
                }

                if($(this).hasClass("cancel")) {
                    // Centauri.Notify("primary", "File-Selector", "No image has been selected.");
                }

                $modal.show();
                Centauri.Components.FileSelectorComponent("close");
            });
        });

        $("#file-selector-search", $fileselector).keyup(function(e) {
            let value = $(this).val();

            $(".items .item", $fileselector).hide();

            if(value == "") {
                $(".items .item", $fileselector).show();
                return;
            }

            $(".items .item", $fileselector).each(function() {
                let title = $.trim($(".title", $(this)).text());

                if(Centauri.strContains(title, value)) {
                    $(this).show();
                }
            });
        });
    }

    if(type == "close") {
        $("#file-selector").addClass("inactive");

        setTimeout(() => {
            $("#file-selector").remove();
        }, 660);
    }

    else {
        console.warn("Centauri.Components.FileSelectorComponent: Type: " + type + " does not exists!");
    }
};

Centauri.Components.FileSelectorComponent.AnimatedSelectedFiles = true;


Centauri.Components.ModulesComponent = function(data) {
    if(data.type == "init") {
        $("#dashboard #modules .module").each(function() {
            $module = $(this);

            $module.on("click", function() {
                var $thismodule = $(this);

                if(Centauri.Components.EditorComponent("isOpen")) {
                    Centauri.fn.Modal(
                        Centauri.__trans.modals.areyousure,
                        Centauri.__trans.modals.editorcomponent_switch,

                        {
                            id: "areyousure_switch_editorcomponent_to_dashboard",

                            close: {
                                label: Centauri.__trans.modals.btn_cancel,
                                class: "warning"
                            },

                            save: {
                                label: Centauri.__trans.modals.btn_switch,
                                class: "danger"
                            }
                        },

                        {
                            save() {
                                Centauri.Components.EditorComponent("close");

                                Centauri.Components.ModulesComponent({
                                    type: "switch",
                                    moduleEl: $thismodule
                                });
                            }
                        }
                    );
                } else {
                    Centauri.Components.ModulesComponent({
                        type: "switch",
                        moduleEl: $thismodule
                    });
                }
            });
        });

        setTimeout(function() {
            if(Centauri.elExists($("#dashboard #modules .module.active"))) {
                $("#dashboard #modules .module.active").trigger("click");
            } else {
                if((location.href + "/" == location.origin + Centauri.Utility.PathsUtility.root + Centauri.Utility.PathsUtility.centauri)) {
                    $("#dashboard #modules .module[data-module-id='" + Centauri.defaultModule + "']").trigger("click");
                }
            }
        }, 333);

        $("#dashboard #user i").on("click", function() {
            $("#dashboard #user").toggleClass("active");
            $("#dashboard #user .dropdown-view").slideToggle();
        });
    }

    if(data.type == "switch") {
        $(".overlayer").removeClass("hidden");

        var $module = $(data.moduleEl);
        var moduleID = $module.data("module-id");

        Centauri.fn.Ajax(
            "Modules",
            "show",

            {
                moduleid: moduleID
            },

            {
                success: function(data) {
                    $("#dashboard #modules .module.active").removeClass("active");
                    $module.addClass("active");

                    $(".overlayer").addClass("hidden");
                    $("#content").html(data);

                    Centauri.Events.OnModuleLoadEvent(moduleID);
                },

                error: function(data) {
                    $(".overlayer").addClass("hidden");
                }
            }
        );
    }

    if(data.type == "load") {
        var module = data.module;

        Centauri.fn.Ajax(
            "Modules",
            "show",

            {
                moduleid: module
            },

            {
                success: function(sData) {
                    $(".overlayer").addClass("hidden");
                    $("#content").html(sData);

                    Centauri.Events.OnModuleLoadEvent(module);

                    Centauri.DAPLoader.historyPushState = true;

                    if(Centauri.isNotUndefined(data.cb)) {
                        data.cb();
                    }
                },

                error: function(data) {
                    $(".overlayer").addClass("hidden");
                    console.error(data);
                }
            }
        );
    }
};

