Centauri.Events.OnOverlayerHiddenEvent = function(closer) {
    $(".overlayer").addClass("hidden");

    if(closer == "EditorComponent") {
        Centauri.Components.EditorComponent("hide");
    }

    else if(closer == "DashboardView") {
        $("#dashboard, .hamburger").removeClass("active");
    }

    else if(closer == "FileSelectorComponent") {
        $("#file-selector").addClass("inactive");
        $(".overlayer").attr("data-closer", "EditorComponent");
    }
};

Centauri.Helper.FieldsHelper = function(element, parentSelector) {
    var datas = [];

    $(parentSelector + " .md-form > input", $(element)).each(function() {
        var id = $(this).attr("data-id");

        if(Centauri.isNotUndefined(id)) {
            var val = $(this).val();

            if($(this).hasClass("image-input")) {
                datas.push({
                    type: "NORMAL",
                    id: id,
                    value: parseInt(val),
                    inlineparent: $(this).parent().parent().parent().parent().data("type-parent"),
                    inline: $(this).parent().parent().parent().parent().data("type"),
                    uid: $(this).parent().parent().parent().data("uid")
                });
            } else {
                datas.push({
                    type: "NORMAL",
                    id: id,
                    value: val,
                    inlineparent: $(this).parent().parent().parent().parent().data("type-parent"),
                    inline: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().parent().data("type") : false),
                    uid: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().data("uid") : $(this).parent().parent().parent().parent().data("uid"))
                });
            }
        }
    });

    $(parentSelector + " .md-form > .md-textarea", $(element)).each(function() {
        var id = $(this).attr("data-id");

        if(Centauri.isNotUndefined(id)) {
            var val = $(this).html();

            datas.push({
                type: "NORMAL",
                id: id,
                value: val,
                inlineparent: $(this).parent().parent().parent().parent().data("type-parent"),
                inline: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().parent().data("type") : false),
                uid: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().data("uid") : $(this).parent().parent().parent().parent().data("uid"))
            });
        }
    });

    $(parentSelector + " select", $(element)).each(function() {
        var id = $(this).attr("data-id");

        if(Centauri.isNotUndefined(id)) {
            var val = $(this).val();

            datas.push({
                type: "NORMAL",
                id: id,
                value: val,
                inlineparent: $(this).parent().parent().parent().parent().data("type-parent"),
                inline: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().parent().data("type") : false),
                uid: ($(this).data("inline-record") == 1 ? $(this).parent().parent().parent().data("uid") : $(this).parent().parent().parent().parent().data("uid"))
            });
        }
    });

    /**
     * @todo
     * 
     * !!! Image selector and push to datas-variable for saving into DB !!!
     */

    // Inline-Records "connection"
    $(parentSelector + " .md-form > .accordions.inline-records", $(element)).each(function(aindex, parentAccordion) {
        $(".accordion", $(parentAccordion)).each(function(bindex, accordion) {
            Centauri.Helper.FieldsHelper($(accordion), ".bottom");
        });
    });

    console.table(datas);

    return datas;
};

// Centauri.Helper.findByPidHelper(Centauri.Components.PagesComponent.uid);

Centauri.Helper.findByPidHelper = (pid, $contentelement=null) => {
    Centauri.fn.Ajax(
        "ContentElements",
        "findByPid",

        {
            pid: pid
        },

        {
            success: function(data) {
                // Centauri.fn.Ajax.Overlayer = true;
                $(".overlayer").removeClass("hidden");

                var $container = $("#editor > .bottom > .container");
                $container.html(data);

                /**
                 * Initializing edit-button for elements
                 */
                Centauri.Helper.PagesHelper($container);

                /**
                 * Registering click-event for newCEButton
                 */
                Centauri.Modal.NewContentElementModal();

                /**
                 * Initializing CKEditor 5
                 */
                Centauri.Service.CKEditorInitService();

                /**
                 * Initializing AccordionComponent for InlineRecords this element may has
                 */
                Centauri.Components.AccordionComponent();
            }
        }
    );
};

Centauri.Helper.ModalHelper = Centauri.Helper.ModalHelper || {};
Centauri.Helper.ModalHelper.Element = Centauri.Helper.ModalHelper.Element || null;

Centauri.Helper.PagesHelper = function($container) {
    var $tops = $(".top", $container);

    $tops.each(function() {
        var $top = $(this);

        $(".edit", $top).on("click", function() {
            var $this = $(this);

            var $top = $this.parent();
            $contentelement = $top.parent();

            $contentelement.toggleClass("active");

            if(!Centauri.elExists($contentelement.find(".fields"))) {
                Centauri.fn.Ajax(
                    "ContentElements",
                    "findFieldsByUid",

                    {
                        uid: $contentelement.attr("data-uid")
                    },

                    {
                        success: function(data) {
                            $(".overlayer").removeClass("hidden");

                            $contentelement.append(data);

                            Centauri.View.ContentElementsView($contentelement);

                            Centauri.Components.CreateNewInlineComponent();
                            Centauri.Components.AccordionComponent();

                            $(".fields select", $contentelement).materialSelect();

                            /**
                             * Initializing CKEditor 5
                             */
                            Centauri.Service.CKEditorInitService();

                            /**
                             * Initializing ColorPickers
                             */
                            $(".color-picker", $contentelement).each(function() {
                                let $_this = $(this);

                                new Pickr({
                                    el: ".color-picker",
                                    default: "rgba(0, 0, 0, 1)",

                                    components: {
                                        preview: true,
                                        opacity: true,
                                        hue: true,

                                        interaction: {
                                            hex: true,
                                            rgba: true,
                                            hsla: true,
                                            input: true,
                                            clear: true,
                                            save: true
                                        }
                                    },

                                    onSave: (hsva, instance) => {
                                        $(instance._root.root).parent().find("> input").val(hsva.toRGBA().toString());
                                    }
                                });
                            });


                            $(".row button", $contentelement).on("click", function() {
                                var uid = $(this).parent().parent().parent().parent().data("uid");
                                var trigger = $(this).data("trigger");

                                if(trigger == "saveElementByUid") {
                                    var datas = Centauri.Helper.FieldsHelper($(".content-element.active"), ".fields");

                                    Centauri.fn.Ajax(
                                        "ContentElements",
                                        "saveElementByUid",

                                        {
                                            uid: uid,
                                            datas: JSON.stringify(datas)
                                        },

                                        {
                                            success: function(data) {
                                                data = JSON.parse(data);
                                                Centauri.Notify(data.type, data.title, data.description);
                                            },

                                            error: function(data) {
                                                console.error(data);
                                            }
                                        }
                                    );
                                }

                                if(trigger == "hideElementByUid") {
                                    $(this).toggleClass("btn-primary btn-info");
                                    $("i", $(this)).toggleClass("fa-eye fa-eye-slash");

                                    Centauri.fn.Ajax(
                                        "ContentElements",
                                        "hideElementByUid",

                                        {
                                            uid: uid
                                        },

                                        {
                                            success: function(data) {
                                                data = JSON.parse(data);
                                                Centauri.Notify(data.type, data.title, data.description);
                                            },

                                            error: function(data) {
                                                console.error(data);
                                            }
                                        }
                                    );
                                }

                                if(trigger == "deleteElementByUid") {
                                    Centauri.fn.Modal(
                                        Centauri.__trans.modals.areyousure,
                                        "Do you want to continue deleting this element?",
                
                                        {
                                            id: "areyousure_deleteelement",

                                            close: {
                                                label: Centauri.__trans.modals.btn_cancel,
                                                class: "warning"
                                            },
                
                                            save: {
                                                label: Centauri.__trans.modals.btn_delete,
                                                class: "danger"
                                            }
                                        },
                
                                        {
                                            save() {
                                                Centauri.fn.Ajax(
                                                    "ContentElements",
                                                    "deleteElementByUid",

                                                    {
                                                        uid: uid
                                                    },

                                                    {
                                                        success: function(data) {
                                                            data = JSON.parse(data);
                                                            Centauri.Notify(data.type, data.title, data.description);
                                                            Centauri.fn.Ajax.Overlayer = false;
                                                            Centauri.Helper.findByPidHelper(Centauri.Components.PagesComponent.uid);
                                                        },

                                                        error: function(data) {
                                                            console.error(data);
                                                        }
                                                    }
                                                );
                                            }
                                        }
                                    );
                                }
                            });

                            setTimeout(function() {
                                $(".fields", $contentelement).slideDown(function() {
                                    $this.toggleClass("btn-primary btn-info");
                                    Centauri.View.ContentElementsView($contentelement);
                                });
                            }, 100);
                        },

                        error: function(data) {
                            console.error(data);
                        }
                    }
                );
            } else {
                $fields = $contentelement.find(".fields");

                $fields.slideToggle(function() {
                    $this.toggleClass("btn-primary btn-info");
                });
            }
        });
    });
};

Centauri.Helper.VariablesHelper.__CME__FIELDS = {};
