Centauri.Events.Window.OnInputFileChange = function(element) {
    var id = $(element).attr("id");
    var file = document.querySelector("input[type=file]").files[0];

    var reader = new FileReader();
    reader.addEventListener("load", function() {
        var base64 = reader.result;
        Centauri.Helper.VariablesHelper.__CME__FIELDS[id] = base64;
        Centauri.Helper.VariablesHelper.__CME__FIELDS[id] = Centauri.Service.ImageService("findBlobByID", id);

        if(Centauri.Events.Window.OnInputFileChange.ShowImagePreview) {
            // var imgData = Centauri.Service.ImageService("findBlobByID", id);
            var imgData = Centauri.Helper.VariablesHelper.__CME__FIELDS[id];

            $(element).parent().parent().append("<img src='" + imgData.blobURL + "' class='img-fluid' style='margin-top: 30px; margin-right: 30px;' />");
        }

        if(id == "filelist_upload") {
            Centauri.fn.Modal(
                Centauri.__trans.modules[Centauri.Module],
                "<div class='md-form'><input id='file_name' type='text' class='form-control' /><label>" + Centauri.__trans.global.label_title + "</label></div>",

                {
                    id: "new_filelistupload",

                    close: {
                        label: "",
                        class: "danger fas fa-times"
                    },

                    save: {
                        label: "",
                        class: "success fas fa-save"
                    }
                },

                {
                    save() {
                        var name = $("#modal-new_filelistupload #file_name").val();

                        var formData = new FormData();
                        formData.append("_method", "HEAD");
                        formData.append("file", Centauri.Helper.VariablesHelper.__CME__FIELDS[id].blob);
                        formData.append("name", name);

                        $.ajax({
                            type: "POST",
                            url: Centauri.Utility.PathsUtility.root + Centauri.Utility.PathsUtility.centauri + Centauri.Utility.PathsUtility.ajax + "File/upload",
                            data: formData,
                            cache: false,
                            contentType: false,
                            processData: false,

                            success: (data) => {
                                Centauri.Notify("success", "Filelist - Upload", "File '" + name + "' has been uploaded");

                                Centauri.Components.ModulesComponent({
                                    type: "load",
                                    module: "filelist"
                                });
                            },

                            error: (data) => {
                                console.error(data);
                            }
                        });
                    }
                }
            );
        }
    }, false);

    // Triggers load-eventListener
    if(file) {
        reader.readAsDataURL(file);
    }
};

Centauri.Events.Window.OnInputFileChange.ShowImagePreview = true;

Centauri.Events.Window.OnLoadResize = function() {
    Centauri.Events.Window.OnLoadResize.fn__handle = function(type) {
        Centauri.Helper.VariablesHelper.__Width = $(window).outerWidth();
        Centauri.Helper.VariablesHelper.__Height = $(window).outerHeight();

        if(Centauri.Helper.VariablesHelper.__Width < 767) {
            Centauri.Helper.VariablesHelper.__BreakpointView = "sm";
        }

        if(Centauri.Helper.VariablesHelper.__Width >= 768) {
            Centauri.Helper.VariablesHelper.__BreakpointView = "md";
        }

        if(Centauri.Helper.VariablesHelper.__Width >= 992) {
            Centauri.Helper.VariablesHelper.__BreakpointView = "lg";
        }

        if(Centauri.Helper.VariablesHelper.__Width >= 1200) {
            Centauri.Helper.VariablesHelper.__BreakpointView = "xl";
        }

        if(type == "resize") {
            if(
                (
                    Centauri.Helper.VariablesHelper.__BreakpointView == "xl"
                ||
                    Centauri.Helper.VariablesHelper.__BreakpointView == "lg"
                )
            &&
                $(".overlayer").attr("data-closer") == "DashboardView"
            ) {
                $(".overlayer").addClass("hidden");
                Centauri.Events.OnOverlayerHiddenEvent($(".overlayer").attr("data-closer"));
            }
        }
    };

    $(window).on("load", function() {
        Centauri.Events.Window.OnLoadResize.fn__handle("load");
    });

    $(window).on("resize", function() {
        Centauri.Events.Window.OnLoadResize.fn__handle("resize");
    });
};

Centauri.Utility.EditorUtility.getCustomHTMLByType = function(inputObj) {
    var html = "";
    var type = inputObj.custom;
    var data = inputObj.data;

    var additionalFieldClasses = "";

    if(type == "select") {
        var options = "";

        var labelHTML = "<label class='mdb-main-label' for='" + inputObj.id + "'>" + data.label + "</label>";
        html = "<select id='" + inputObj.id + "' class='mdb-select select2 colorful-select dropdown-primary md-form' searchable='" + Centauri.__trans.global.searchhere + "' " + (Centauri.isNotUndefined(data.required) ? (data.required ? "required" : "") : "required") + ">|</select>";

        if(Centauri.isNotUndefined(data.label)) {
            html.split("|").join("<option value='' disabled selected>" + data.label + "</option>|");
            html = html + labelHTML;
        }

        if(Centauri.isNotUndefined(data.options)) {
            $.each(data.options, function(index, optionObj) {
                if(Centauri.isNotUndefined(data.selectedOptionValue)) {
                    if(data.selectedOptionValue == optionObj.value) {
                        options += "<option value='" + optionObj.value + "' selected>" + optionObj.name;
                    } else {
                        options += "<option value='" + optionObj.value + "'>" + optionObj.name;
                    }
                } else {
                    options += "<option value='" + optionObj.value + "'>" + optionObj.name;
                }
            });
        }

        html = html.split("|").join(options);
    }

    if(type == "image") {
        html = "<label class='d-block m-0'>" + data.label + "</label><img src='" + data.src + "' class='img-fluid' style='width: 30px;' />";
    }

    if(type == "checkbox") {
        var checked = "";

        if(Centauri.isNotUndefined(data.isChecked)) {
            if(data.isChecked) {
                checked = " checked";
            }
        }

        additionalFieldClasses = " custom-control custom-checkbox";
        html = "<input id='" + inputObj.id + "' class='custom-control-input' type='checkbox'" + checked + " /><label class='custom-control-label d-block m-0' for='" + inputObj.id + "'>" + data.label + "</label>";
    }

    if(type == "switch") {
        var checked = "";
        var onClick = "";

        if(Centauri.isNotUndefined(data.isChecked)) {
            if(data.isChecked) {
                checked = " checked";
            }
        }

        if(Centauri.isNotUndefined(data.onClick)) {
            var onClick = " onclick='" + data.onClick + "'";
        }

        additionalFieldClasses = " switch";
        html = "<label><input type='checkbox'" + checked + " id='" + inputObj.id + "'" + onClick + " /><span class='ml-1 lever'></span>" + data.label + "</label>";
    }

    return "<div class='field" + additionalFieldClasses + "'" + (Centauri.isNotUndefined(inputObj.extraAttr) ? " " + inputObj.extraAttr : "") + ">" + html + "</div>";
};

Centauri.Utility.EditorUtility.Validator = function() {
    var $input = $("form input", $editor);

    $input.on("focusout", function() {
        var required = $(this).attr("required");

        if(Centauri.isNotUndefined(required)) {
            var value = $(this).val();

            if(value == "") {
                $(this).addClass("error");
            }
        }
    });

    $input.on("keyup", function() {
        var required = $(this).attr("required");

        if(Centauri.isNotUndefined(required)) {
            var value = $(this).val();

            if($(this).hasClass("error")) {
                if(value != "") {
                    $(this).removeClass("error");
                }
            } else {
                if(value == "") {
                    $(this).addClass("error");
                }
            }
        }
    });
};

Centauri.Utility.ModalUtility.Validator = function($modal) {
    var $input = $("input", $modal);
    var $select = $("select", $modal);

    $input.on("focusout", function() {
        var required = $(this).attr("required");

        if(Centauri.isNotUndefined(required)) {
            var value = $(this).val();

            if(value == "") {
                $(this).addClass("error");
            }
        }
    });

    $input.on("keyup", function() {
        var required = $(this).attr("required");

        if(Centauri.isNotUndefined(required)) {
            var value = $(this).val();

            if($(this).hasClass("error")) {
                if(value != "") {
                    $(this).removeClass("error");
                }
            } else {
                if(value == "") {
                    $(this).addClass("error");
                }
            }
        }
    });

    $select.on("change", function() {
        let required = $(this).attr("required");
        let $ul = $(this).prev();

        if(Centauri.isNotUndefined(required)) {
            if($("li", $ul).hasClass("active")) {
                $(this).parent().find("input").removeClass("error");
            }
        }
    });

    $("button[data-type='save']").click(function(e) {
        let hasError = false;

        $("input", $modal).each(function() {
            var val = $(this).val();
            var required = $(this).attr("required");

            if(val == "" && Centauri.isNotUndefined(required)) {
                hasError = true;

                if(!$(this).hasClass("error")) {
                    $(this).addClass("error");
                }
            }
        });

        $("select", $modal).each(function() {
            let required = $(this).attr("required");
            let $ul = $(this).prev();

            if(Centauri.isNotUndefined(required)) {
                if(!$("li", $ul).hasClass("active")) {
                    hasError = true;
                    $(this).parent().find("input").addClass("error");
                }
            }
        });

        if(hasError) {
            e.preventDefault();
            e.stopImmediatePropagation();
            e.stopPropagation();

            Centauri.Notify("error", "Form Validation", "Please fill out all fields!");
        }
    });
};

Centauri.Events.EditorComponent.Select.OnChange = function(select) {
    var dataID = $editor.attr("data-id");
    var id = $(select).attr("id");

    var required = $(select).attr("required");
    var value = $(select).val();
    var option = $(select).find("option[value='" + value + "']");

    if(Centauri.isNotUndefined(required)) {
        $(select).parent().find("input").removeClass("error");
    }

    if(
        Centauri.strContains(dataID, "TranslatePage-")
    ||
        dataID == "CreateNewPage"
    ) {
        if(Centauri.Events.EditorComponent.Select.OnChange.PrefillSlug) {
            if(id == "language") {
                var slugs = $.trim($(option).text()).toLowerCase();
                slugs = slugs[0] + slugs[1];

                $("form #url", $editor).focus();
                $("form #url", $editor).val(slugs);
            }
        }
    }

    if(dataID == "CreateNewPage") {
        if(Centauri.Events.EditorComponent.Select.OnChange.PrefillSlug) {
            var uid = "";
            var $tr = null;

            $("table#pages td[data-type='uid']").each(function() {
                var nUid = $.trim($(this).text());
                if(nUid[2] == value) {
                    uid = parseInt(nUid[2]);
                    $tr = $(this).parent();
                }
            });

            if(Centauri.isNotNull($tr) && Centauri.elExists($tr) && Centauri.isNotUndefined($tr)) {
                var slugs = $.trim($tr.find("td[data-type='url']").text());
                if(slugs != "/") {
                    slugs += "/";
                }

                $("form #url", $editor, $editor).focus();

                if(uid != parseInt($.trim($("table#pages tr:first-child td[data-type='uid']").text()))) {
                    if(slugs != "/") {
                        $("form #url", $editor).val(slugs + $("form #title", $editor).val());
                    } else {
                        $("form #url", $editor).val(slugs + $("form #title", $editor).val().toLowerCase());
                    }
                }

                // if(slugs != "/") {
                $("form #title", $editor, $editor).focus();
                // }
            }
        }
    }
};

